const theme = {
  colors: {
    background: '#f5f5f5',     // Light Gray (background)
    text: '#333333',           // Charcoal Gray (text)
    primary: '#0f1a22',        // Dark Slate Blue (primary)
    secondary: '#ffb6c1',      // Pastel Pink (secondary)
    accent: '#98fb98',         // Pastel Green (accent)
    cta: '#fdfd96',            // Pastel Yellow (call to action)
    accent2: '#c7a1ff',        // Pastel Purple (additional accent)
  },
};

export default theme;
